/**
 * freact function causes React and ReactDOM variables to be automatically available
 */
function freact() {
    var child, i, len, ref, span;
    span = document.createElement('span');
    span.innerHTML = '<div id="example-react-in-js"></div>';
    ref = span.children;
    for (i = 0, len = ref.length; i < len; i++) {
        child = ref[i];
        document.body.appendChild(child);
    }
    span = null;
    ReactDOM.render(<h1>Hello, world! Javascript</h1>, document.getElementById('example-react-in-js'));
    
    return console.log('react-in-js');
}